create table [Notification](
	notiID int identity(1,1) primary key,
	title nvarchar(200) not null,
	content nvarchar(max) not null,
	dateSend datetime not null,
	isRead bit not null,
	isForAdmins bit not null
)

create table ReceiverType (
    ReceiverTypeId int identity(1,1) primary key,
    name nvarchar(200) not null
);

insert into ReceiverType values ('Shipper')
insert into ReceiverType values ('Supplier')

create table [NotificationReceiver] (
    notiReceiverId int identity(1,1) primary key,
    notiID int not null,
    receiverType int not null, -- To identify which table the receiver belongs to (supplier, shipper, customer,.....)
	receiverID int not null,

    FOREIGN KEY (notiID) REFERENCES [Notification](notiID),
	FOREIGN KEY (receiverType) REFERENCES ReceiverType(ReceiverTypeId)
);

